import React from 'react';
import './Header.css';

const Header =()=>{
    return(
        <header>
            <div className='container'>
                <div className='col-md-6'>
                    <h2 className='h2'>Design is my life</h2>
                    <p className='paragraph'>
                    Graphic design is the profession and academic discipline whose activity
                     consists in projecting visual communications intended to transmit
                      messages to social groups with specific objectives, using an applied art 
                      consisting of the use of text and graphics to communicate visually. 
                    </p>
                </div>
                <fiv className='col-md-6'></fiv>

            </div>
        </header>
    )
}
export default Header ;
